def gen_bank_card(card_type='bank', cardBin='95555'):
    if card_type == 'bank':
        cardLen = cardLenList[cardBin]
    elif card_type == 'credits':
        cardLen = credits_cardLenList[cardBin]
    #         print '卡号长度：',cardLen
    ran_timestamp = str(round(time.time()))
    if len(cardBin) != 6:
        cardLen = cardLen - len(cardBin) + 6
    #         print str(cardBin),ran_timestamp[0:(cardLen-9)],random.randint(10,99)
    #         print ran_timestamp,type(ran_timestamp)
    bank_card = str(cardBin) + ran_timestamp[0:(cardLen - 9)] + str(random.randint(10, 99))
    sumOdd = sumEven = 0
    count = 0
    #         print len(bank_card)
    for bank_card_value in bank_card[::-1]:
        if (count % 2) == 0:
            # print(bank_card_value+" | {0} 是偶数".format(count))
            if int(bank_card_value) * 2 > 9:
                sumEven += (int(bank_card_value) * 2 - 9)
            else:
                sumEven += int(bank_card_value) * 2
        else:
            # print(bank_card_value+" | {0} 是奇数".format(count))
            sumOdd += int(bank_card_value)
        count = count + 1
    if (sumEven + sumOdd) % 10 != 0:
        last_digit = 10 - (sumEven + sumOdd) % 10
    else:
        last_digit = 0
    bank_card = bank_card + str(last_digit)
    return bank_card

